  return (
    <div className='login-cont'>
      <h2>Welcome</h2>
      <div className='login-form'>
        <input
          required
          placeholder='Enter userid'
          type='text'
          name='userid'
          onChange={(e) => {
            setUserid(e.target.value);
          }}
        />
        <input
          placeholder='Enter password'
          type='text'
          name='pass'
          onChange={(e) => {
            setPass(e.target.value);
          }}
        />
        <button onClick={handleSignupBtn}>Sign-up</button>

      </div>
    </div>
  )
}

